    <div id="contact" className="contact" >
      <h2 className='mt-8 underline decoration-wavy italic font-semibold'>Contact Me</h2>
      <div className='flex items-center justify-center'>
        <div style={{ display: 'flex', alignItems: 'center', marginBottom: '10px' }}>
          <FaPhone style={{ marginRight: '8px', color: '#0073e6' }} /> {/* Telefon ikonu */}
          <span>+90 555 123 4567</span> {/* Telefon numarasÄ± */}
        
          <FaEnvelope style={{ marginRight: '8px', color: '#0073e6' }} /> {/* Mail ikonu */}
          <span>example@example.com</span> {/* E-posta adresi */}
        </div>
      </div>
    </div>
  );
}
